import { NgModule } from "@angular/core";
import { CommonModule } from "@angular/common"; 
import { Component } from "@angular/core"; 

@Component({ 
  selector: "my-component", 
  template: ` 
    <header class="main-container"> 
      <div class="image-wrapper"> 
        <div class="description"> 
          <div class="title">Plant trees for free</div> 
          <div class="title">Make the planet better</div> 
        </div> 
      </div> 
      <form class="input-form"> 
        <div class="input-wrapper"> 
          <input class="input" type="text" aria-label="Username" /> 
          <label class="input-label">Username</label> 
        </div> 
        <div class="input-wrapper"> 
          <input class="input" type="password" aria-label="Password" /> 
          <label class="input-label">Password</label> 
        </div> 
        <button class="button">LOGIN</button> 
      </form> 
      <div class="register-wrapper"> 
        <div class="register-title">Otherwise, please</div> 
        <div class="register-link">Register here</div> 
      </div> 
    </header> 
  `, 
  styles: [ 
    `
    .main-container { 
      justify-content: center; 
      align-self: stretch; 
      background-color: var(--whitePure, #081c15); 
      display: flex; 
      max-width: 955px; 
      flex-direction: column; 
      padding: 50px 16px; 
    }

    .image-wrapper { 
      margin: 179px 0 108px; 
    }

    @media (max-width: 991px) { 
      .image-wrapper { 
        max-width: 100%; 
        margin: 40px 0; 
      } 
    }

    .description { 
      gap: 20px; 
      display: flex; 
    }

    @media (max-width: 991px) { 
      .description { 
        flex-direction: column; 
        align-items: stretch; 
        gap: 0px; 
      } 
    }

    .title { 
      color: var(--greenDark, #e8f5f1); 
      letter-spacing: 0.25px; 
      font: 400 34px/118% Roboto, sans-serif; 
    }

    @media (max-width: 991px) { 
      .title { 
        max-width: 100%; 
      } 
    }

    .input-form { 
      display: flex; 
      flex-direction: column; 
      line-height: normal; 
      width: 55%; 
      margin-left: 0px; 
    }

    @media (max-width: 991px) { 
      .input-form { 
        width: 100%; 
      } 
    }

    .input-wrapper { 
      align-self: stretch; 
      display: flex; 
      flex-direction: column; 
      margin: auto 0; 
    }

    @media (max-width: 991px) { 
      .input-wrapper { 
        max-width: 100%; 
        margin-top: 40px; 
      } 
    }

    .input { 
      color: var(--greenDark, #e8f5f1); 
      white-space: nowrap; 
      font: 400 23px/139% Roboto, sans-serif; 
    }

    @media (max-width: 991px) { 
      .input { 
        white-space: initial; 
      } 
    }

    .input-label { 
      color: var(--greenDark, #e8f5f1); 
      letter-spacing: 0.5px; 
      margin-top: 40px; 
      font: 400 16px/150% Roboto, sans-serif; 
    }

    .button { 
      background-color: var(--black-087, rgba(0, 0, 0, 0.87)); 
      text-align: center; 
      letter-spacing: 1.25px; 
      text-transform: uppercase; 
      white-space: nowrap; 
      justify-content: center; 
      align-items: center; 
      border-radius: 4px; 
      background-color: var(--grey-lighten-4, #f5f5f5); 
      margin-top: 32px; 
      padding: 0 60px; 
      font: 500 14px/36px Roboto, sans-serif; 
    }

    @media (max-width: 991px) { 
      .button { 
        white-space: initial; 
        padding: 0 20px; 
      } 
    }

    .register-wrapper { 
      align-items: center; 
      display: flex; 
      margin-top: 32px; 
      justify-content: space-between; 
      gap: 6px; 
    }

    .register-title { 
      color: var(--greenDark, #e8f5f1); 
      margin: auto 0; 
      font: 400 14px Poppins, sans-serif; 
    }

    .register-link { 
      color: var(--greenDark, #e8f5f1); 
      font: 600 16px Poppins, sans-serif; 
    }
    `, 
  ],
})
export class MyComponent {}
